import React from 'react';
import photo1 from "./photo/IMG_2014.jpg";

const Library = () => {
  return (
    <>
        <h2>Library</h2>
        <div className="grid">
            <img src={photo1} alt="" />
        </div>
    </>
  )
}

export default Library
